import { ToastContainer } from 'react-toastify';
import './App.css';
import { QueryClientProvider } from '@tanstack/react-query';
import SiteRouter from './Components/SiteRouter';


function App() {
  
  return (
    <div className="App">
       <QueryClientProvider >
      <ToastContainer/>
      <SiteRouter/>
      </QueryClientProvider>
    </div>
  );
}

export default App;
